import { Component } from "react"

let data = [...new Array(50)].map(() => 0)

let Content = props => {
	const style = {
		display:'flex',
		width: '100%',
		height: '100%',
		background: '#0C0C0C',

		chart: {
			width: '100%', 
			height: '100%',
			background: '#0C0C0C',
			color: 'orange',
			margin: 0,
			padding: 0,
			borderStyle: 'none'
		}
	}

	//data.unshift()
	//data.push(props.event.data)

	return <div style={style} >
			<Component.Lines width={200} height={200} data={data} max={1000} />
		</div>
}

const Histogram = props => {
	let {Component, event, asset, offset, onFocused, onDragged, onClose} = props


	return <Component.Window
			offset={offset}
			onFocused={onFocused}
			onDragged={onDragged}
			icon={asset.icon}>
		<Content event={event} onClose={onClose} />
</Component.Window>


}

export default Histogram
